import React, { Component } from 'react';
import { Button } from 'semantic-ui-react';

class App extends Component{

    render(){
        return(
            <div>
                <h2>Edu-ledger</h2>
                <Button primary>Student</Button>
            </div>
        )
    };
}

export default App;
